property.value:
function init() self.values['x'] = 0 end
function onValueChanged(val) if (val == "x" and self.values['x'] == 1) then root:notify("randomAllDials")
-- now do the effect selection root:findByName("characterButtons", true):notify("switchSelect", math.random(0, 5)) root:findByName("movementButtons", true):notify("switchSelect", math.random(0, 5)) root:findByName("diffusionButtons", true):notify("switchSelect", math.random(0, 5)) root:findByName("textureButtons", true):notify("switchSelect", math.random(0, 5)) end end
